      [RunParameter("Function Conflict Option", FunctionConflictOption.RAISE, "Option to deal with function definition conflicts. For example, if FT1 is defined as 'length / speed * 60' in the current Emmebank, but defined as 'length / us1 * 60' in the NWP's functions file.One of RAISE, PRESERVE or OVERWRITE. RAISE (default) raises an error if any conflict is detected. PRESERVE keeps the definitions that already exist in the Emmebank (no modification). OVERWRITE modifies the definitions to match what is given in the NWP file.")]

